import React from 'react';
import Topbar from './layouts/pages/topbar';
import Sidebar from './layouts/pages/sidebar';


import { Route,BrowserRouter  } from 'react-router-dom';
import Employe from './components/employe/Employe';
import ListConge from './components/conge/ListConge';

const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Topbar />
      <Sidebar />
      {/* <Section routes={PageRoute} /> */}
      <Route path="/" component={Employe} />
      <Route path="/listConge" component={ListConge} />
      <div className="footer">Footer de notre site, créer par le dévéloppeur kratos bosse</div>
      </BrowserRouter>
  </div>
  )
}

export default App;
